import React from 'react';
import HomeLanding from '../../components/homeLanding/homeLanding';
import RoomList from '../../components/roomList/roomList';

import './home.css';

function HomePage() {
    return (
        <div id='home'>
            <HomeLanding />
            <RoomList />
        </div>
    )
}

export default HomePage;
